import React from 'react';
import { Box, Container, Grid, Typography, IconButton, Link } from '@mui/material';
import { styled } from '@mui/material/styles';
import { Link as RouterLink } from 'react-router-dom';
import YouTubeIcon from '@mui/icons-material/YouTube';
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter';
import InstagramIcon from '@mui/icons-material/Instagram';
import GitHubIcon from '@mui/icons-material/GitHub';

const FooterContainer = styled(Box)({
  background: 'linear-gradient(135deg, rgba(26, 26, 46, 0.98) 0%, rgba(22, 33, 62, 0.98) 100%)',
  color: 'white',
  padding: '3rem 0',
  marginTop: 'auto',
  borderTop: '1px solid rgba(255, 255, 255, 0.1)',
});

const Logo = styled(Box)({
  display: 'flex',
  alignItems: 'center',
  gap: '0.5rem',
  marginBottom: '1rem',
  '& .MuiSvgIcon-root': {
    color: '#673ab7',
    fontSize: '2rem',
  },
});

const FooterLink = styled(Link)({
  color: 'rgba(255, 255, 255, 0.7)',
  textDecoration: 'none',
  '&:hover': {
    color: '#673ab7',
  },
});

const SocialIcon = styled(IconButton)({
  color: 'rgba(255, 255, 255, 0.7)',
  '&:hover': {
    color: '#673ab7',
    background: 'rgba(103, 58, 183, 0.1)',
  },
});

const FooterSection = styled(Box)({
  '& .MuiTypography-h6': {
    marginBottom: '1rem',
    color: 'white',
    position: 'relative',
    '&::after': {
      content: '""',
      position: 'absolute',
      bottom: '-5px',
      left: 0,
      width: '40px',
      height: '2px',
      background: '#673ab7',
    },
  },
});

const Footer = () => {
  return (
    <FooterContainer component="footer">
      <Container maxWidth="lg">
        <Grid container spacing={4}>
          {/* Logo and Description */}
          <Grid item xs={12} md={4}>
            <Logo>
              <YouTubeIcon />
              <Typography variant="h6" component="span">
                YTDOWN
              </Typography>
            </Logo>
            <Typography variant="body2" sx={{ color: 'rgba(255, 255, 255, 0.7)', mb: 2 }}>
              أداة سهلة وسريعة لتحميل مقاطع فيديو يوتيوب بجودة عالية. يمكنك تحميل الفيديوهات والمقاطع الصوتية بسهولة وأمان.
            </Typography>
          </Grid>

          {/* Quick Links */}
          <Grid item xs={12} sm={6} md={4}>
            <FooterSection>
              <Typography variant="h6">روابط سريعة</Typography>
              <Box sx={{ display: 'flex', flexDirection: 'column', gap: 1 }}>
                <FooterLink component={RouterLink} to="/">الرئيسية</FooterLink>
                <FooterLink component={RouterLink} to="/features">المميزات</FooterLink>
                <FooterLink component={RouterLink} to="/how-to-use">كيفية الاستخدام</FooterLink>
                <FooterLink component={RouterLink} to="/about">حول</FooterLink>
                <FooterLink component={RouterLink} to="/contact">اتصل بنا</FooterLink>
              </Box>
            </FooterSection>
          </Grid>

          {/* Social Links */}
          <Grid item xs={12} sm={6} md={4}>
            <FooterSection>
              <Typography variant="h6">تواصل معنا</Typography>
              <Box sx={{ display: 'flex', gap: 1 }}>
                <SocialIcon aria-label="Facebook">
                  <FacebookIcon />
                </SocialIcon>
                <SocialIcon aria-label="Twitter">
                  <TwitterIcon />
                </SocialIcon>
                <SocialIcon aria-label="Instagram">
                  <InstagramIcon />
                </SocialIcon>
                <SocialIcon aria-label="GitHub">
                  <GitHubIcon />
                </SocialIcon>
              </Box>
              <Typography variant="body2" sx={{ color: 'rgba(255, 255, 255, 0.7)', mt: 2 }}>
                تابعنا على وسائل التواصل الاجتماعي للحصول على آخر التحديثات والأخبار.
              </Typography>
            </FooterSection>
          </Grid>
        </Grid>

        {/* Copyright */}
        <Box sx={{ borderTop: '1px solid rgba(255, 255, 255, 0.1)', mt: 4, pt: 2, textAlign: 'center' }}>
          <Typography variant="body2" sx={{ color: 'rgba(255, 255, 255, 0.7)' }}>
            © {new Date().getFullYear()} YTDOWN. جميع الحقوق محفوظة.
          </Typography>
          <Box sx={{ mt: 1 }}>
            <FooterLink component={RouterLink} to="/privacy" sx={{ mx: 1 }}>
              سياسة الخصوصية
            </FooterLink>
            |
            <FooterLink href="#" sx={{ mx: 1 }}>
              الشروط والأحكام
            </FooterLink>
          </Box>
        </Box>
      </Container>
    </FooterContainer>
  );
};

export default Footer;
